import React from "react";
import styles from "./"
function Contact() {
  return (
    <div className={`${styles.about} `}>
      <div
        className={`container ${styles.test} pt-4 mb-4 d-flex justify-content-center align-items-center text-white vh-100`}
      >
        <div className={`about_content  mb-3 fs-1 fw-bolder `}>
          <h2 className={`upper-text text-center pt-4 `}> CONATCT SECTION</h2>
        </div>

        <div className="about_icon me-3 mb-3 ">
          <i className={`fa-solid fa-star `}></i>
        </div>
      </div>
    </div>
  );
}

export default Contact;
